INSERT INTO `clover_content_news` VALUES (65,18,0,'3D立体画手绘墙保养技巧','<p>手绘墙凭借其所代表的个性、时尚又不乏创新的精神，一出现就受到了年轻人的热捧。虽然现在彩绘墙非常的流行，但是很少有人知道应该如何正确的去保养它。下面小编就跟大家分享一些方法，希望小伙伴们能好好看看。油墨图画时间久了就有落灰、发旧的问题，那么家庭装修手绘墙也会出现这样的问题吗?漂亮富有艺术特色的手绘墙如果失去了最初的光彩，那整个家庭的装修效果就凸显不出来了，还可能让人感觉有些陈旧。今天，小编就来为大家介绍一下手绘墙的保养方法，让你家的手绘墙永远美丽如初。</p>\n<p>1、3D手绘墙保养方法&mdash;&mdash;涂蜡</p>\n<p>　　可以在手绘墙的墙体涂一层自然蜂蜡，这种蜡能有效的将墙体与空气中的水分隔离，防止墙皮脱落。一般这种蜡在卖美术用品的商店里都有卖。</p>\n<p>&nbsp; &nbsp;2、手绘墙保养方法&mdash;&mdash;不要被直射</p>\n<p>　　在绘制手绘墙时，一定要挑选没有阳光直射的墙体进行绘制。紫外线对颜色的破坏性很大，会构成褪色和变色。</p>\n<p>3、手绘墙保养方法&mdash;&mdash;定期通风</p>\n<p>　　手绘墙所在房间一定要定时定期的进行通风。一般来说手绘墙家庭需要的居多，因此最好手绘墙位置的选择要远离厨房、卫生间等一些容易沾染油污和湿气过重的地方。手绘墙所在的房间最好有一个基本稳定的温度和湿度的环境。</p>\n<p>4、手绘墙保养方法&mdash;&mdash;用布遮盖</p>\n<p>　　如果主人平时外出的话，外出之前最好找一块大床单将手绘墙表面遮罩起来，一来避免墙体落灰，日后难以清洗，二来可以延缓墙体的褪色。</p>\n<p>&nbsp;</p>','/upload/news/2019-09/e0/ba17ed837949e39bd10c29ded44311cacb30cf.jpg','','','publish','all','open','',NULL,1,319,'2019-09-26 10:44:51','2020-04-29 04:08:29',NULL),(58,18,0,'手绘墙面小常识','<p><span style=\"color: #333333; font-family: 宋体, arial, sans-serif; font-size: 14px; background-color: #ffffff;\">Q1：墙绘是用什么材料绘画？</span><br style=\"color: #333333; font-family: 宋体, arial, sans-serif; font-size: 14px; background-color: #ffffff;\" /><span style=\"color: #333333; font-family: 宋体, arial, sans-serif; font-size: 14px; background-color: #ffffff;\">　　A1：用丙烯颜料绘画，水性，环保无污染。丙烯颜料干燥后为柔韧薄膜，坚固耐磨，不变质脱落，不褪色，抗腐蚀，耐水，画好后易于冲洗。</span><br style=\"color: #333333; font-family: 宋体, arial, sans-serif; font-size: 14px; background-color: #ffffff;\" /><span style=\"color: #333333; font-family: 宋体, arial, sans-serif; font-size: 14px; background-color: #ffffff;\">　　Q2：墙绘和墙纸对比？</span><br style=\"color: #333333; font-family: 宋体, arial, sans-serif; font-size: 14px; background-color: #ffffff;\" /><span style=\"color: #333333; font-family: 宋体, arial, sans-serif; font-size: 14px; background-color: #ffffff;\">　　A2：首先，墙纸或者其他装饰材料价格贵，但墙绘只要墙纸三分之一，且比墙纸做出的效果有过之而无不及；另外而墙绘损坏了可以直接修补， 脏了也可以擦洗，但普通的墙你可能要花上不少钱重新粉刷或者换去整面墙的壁纸。</span><br style=\"color: #333333; font-family: 宋体, arial, sans-serif; font-size: 14px; background-color: #ffffff;\" /><span style=\"color: #333333; font-family: 宋体, arial, sans-serif; font-size: 14px; background-color: #ffffff;\">　　Q3：正在装修的话，什么时间进行墙绘最好？</span><br style=\"color: #333333; font-family: 宋体, arial, sans-serif; font-size: 14px; background-color: #ffffff;\" /><span style=\"color: #333333; font-family: 宋体, arial, sans-serif; font-size: 14px; background-color: #ffffff;\">　　A3：一、墙面乳胶漆已干之后；二、安置好家具之后。两种情况各有优劣，前一种是在装修前期介入设计中，后一种是根据家庭装饰来设计以达到墙绘的美感最大化。</span></p>','/upload/news/2019-09/09/c7736d41f1f1c47479d164be7c6c24d9747159.jpg','','','publish','all','open','','',1,348,'2019-09-26 04:41:17','2020-04-28 20:44:32',NULL),(59,18,0,'懂得墙绘知识家装轻松搞定','<p>&nbsp; 上海墙绘设计公司告诉你：懂得墙绘知识家装轻松搞定</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp;1、在选择手绘墙图案的时候，一定要注意图案和色彩要服从整体设计的风格。而图案的选择是多种多样的，可以是来源于中国传统的图案或是纹样，也可以是国画中经常表现出来的图案，也可以是外国的传统图案，或是卡通人物形象，题材很多。而北欧的简约派风格的设计在色彩上较为极端，在黑白灰和超艳丽色彩两端，因此这种风格的图案大多都比较抽象。而现代派的设计图案，色彩较为艳丽，图案都比较写实。</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp;欧式风格的色彩都较为中性，低调，墙面的图案素材大多来自于古典的欧式装饰符号，用来配合欧式的家具，很整体，美观。</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp;2、手绘在哪个位置也很有讲究</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp;一般情况下不建议整个空间都绘上彩色的图案，那只会让空间显得没有层次感。你可以选择主要的墙面，来进行绘制，比如客厅。</p>\n<p>大面积绘制的手绘墙一般是作为家里的主要装饰物，常常给人在视觉上带来很大的视觉冲击力，效果突出，醒目，令人印象深刻。</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp;另外一种是针对比较特殊的空间而针对的绘制，如阳光房可以绘制一些太阳和花鸟为主题的手绘墙画，还有如在楼梯间画树木花草类题材的墙画。</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp;还有一种属于点睛类，比如开关座，或是沙发角落和空调的角落位置，又或者是吊灯的墙面。格调手绘墙在这些地方画上精美绝伦的花朵，和自然味道十足的树木，花草，给家带来十分生动的气氛哦。</p>','/upload/news/2019-09/f7/9ee6586ee3a48b26f704a581c4a844ba859d76.jpg','','','publish','all','open','',NULL,1,353,'2019-09-26 10:17:07','2020-04-29 04:29:25',NULL),(60,18,0,'盘点中国的涂鸦','<p>中国的涂鸦有很浓厚的美式风格，涂鸦形式多为一些变化字体的英文和美式的卡通。一些涂鸦创作者呼吁，中国涂鸦需要有中国人自己的风格。他们认为，涂鸦本身是一种群众艺术，涂鸦需要有一定的生活感。朋克精神和放任不羁的涂鸦激情，被他们一再强调。</p>\n<p>涂鸦一词，原是唐朝卢仝说其儿子乱写乱画顽皮之行，后来人们便从卢仝的诗句里得出&ldquo;涂鸦&rdquo;一词，流传至今。而我们在此所说的&ldquo;涂鸦&rdquo;并非上述的&ldquo;乱涂乱画&rdquo;！&ldquo;涂鸦&rdquo;英文是&ldquo;GRAFFITI&rdquo;。很多不了解涂鸦的人们会认为涂鸦就是乱涂乱画，其实不然。GRAFFITI 是一种视觉字体设计艺术</p>\n<p>随着HIP-HOP热潮的涌入，涂鸦作为街头文化的一部分，涂鸦开始出现在中国的北京、上海、广州这样的大城市里。那时候的涂鸦，是令城市管理者头疼的&ldquo;小广告&rdquo;，而随着城市的发展，涂鸦也逐渐艺术化和商业化，涂鸦不仅见证着中国城市的变迁，涂鸦也在成为城市建筑中一道新风景。</p>\n<p>北京的798艺术区，曾经是涂鸦爱好者的天堂。798墙头的涂鸦秉承了涂鸦艺术的原始风貌，&ldquo;厕所文学&rdquo;的涂鸦味道比较浓郁，涂鸦让人对高雅与低俗的关系产生新的理解。</p>\n<p>上海的莫干山路200米的沿街墙壁上，布满了各色涂鸦作品。这些充满灵性、风格迥异的涂鸦作品展示着涂鸦创作者的才华和理念，同时也为上海平添了几许国际大都市的独特韵味。</p>\n<p>广州的越秀南路，曾经是涂鸦作者的舞台。不过随着城市的发展，用来作为涂鸦画布的墙面，不断被拆除。即使是开放的前言地区，当地涂鸦创作群体也不过数十人。</p>\n<p>另外，武汉、西安、成都等地，街头涂鸦文化均有一定程度发展，出现大批的涂鸦爱好者和顶尖的涂鸦高手。</p>\n<p>&nbsp;</p>','/upload/news/2019-09/e3/ac29af5cbff6605e8e66c6eba872bc4f389f61.jpg','','','publish','all','open','',NULL,1,365,'2019-09-26 10:17:52','2020-04-29 05:23:05',NULL),(61,18,0,'分析手绘墙的一些特点','<p>近年来，手绘墙一直备受关注，央视交换空间节目中反复出现&ldquo;手绘墙&rdquo;这种装饰手法，可见手绘墙这是一种流行，手绘墙一种新的装饰趋势，画之家手绘墙是您时尚家居装修装饰必选的好东西。那么画之家具体说下手绘墙有哪些特点呢</p>\n<p>&nbsp;</p>\n<p>手绘墙的特点：</p>\n<p>1、手绘墙纯手工绘制，艺术性高。手绘墙图案可由客户自己选择，手绘墙彰显自己家居的个性风格。</p>\n<p>2、手绘墙色彩鲜亮，保持时间较壁纸要长得多，价格要低于壁纸，壁纸一般寿命在五年左右，手绘，由于我们采用特殊的材料处理能保持十年之久，且图案表面耐擦洗，可用湿毛巾擦拭，易于清理</p>\n<p>&nbsp; &nbsp;手绘墙在单身公寓里墙面的使用在这样的环境住下来，对于忙碌的工作也增添不了一点休息的空间。帮助房间增加活力，它可以给墙描绘上不一样的风景，对于客户需要怎样的环境，都是可以给予的。</p>\n<p>&nbsp;</p>','/upload/news/2019-09/3c/def3feb70c132bb1b8f9969b2709cd18e8cf7c.jpg','','','publish','all','open','',NULL,1,347,'2019-09-26 10:18:33','2020-04-28 20:44:42',NULL),(62,18,0,'互联网办公室创意涂鸦墙绘','<p>互联网办公室创意涂鸦墙绘，这样一幅由动物与互联网做联想，来创作的一幅很有想象与特色的涂鸦壁画，让办公用品完美的融入到了动物，让它们很好和无缝拼接。可以说是一幅很有视觉冲击力的墙绘壁画。让办公区增添了不少乐趣。</p>','/upload/news/2019-09/aa/e72d8415daf64bfb0a39754c330d593ef31fe3.jpg','','','publish','all','open','',NULL,1,335,'2019-09-26 10:19:11','2020-04-29 04:10:48',NULL),(63,18,0,'分析墙绘来装饰的主要作用','<p>&nbsp; 近年来，随着墙绘的流行和发展，很多人在进行家庭装修的时候都会使用墙绘来进行装饰，这样不但可以有较好的视觉成效，而且颜色鲜艳动人，也为人们的生活增添了些许不一样的气息。那么，使用墙绘方式来进行家庭装修的主要作用是以下两个方面：</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp;一、人们使用墙绘来装饰墙面，不但可以带来较多的色彩成效，而且还可以使其和家庭装修整体上显得自然。另外墙绘一般都是纯手工绘制的，因而具有个性和时尚性。</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp;二、墙绘和其它的色彩比起来具有真实感，不但可以为人们带来不同的颜色和图案，而且可以搭配不同的家居风格，从而传达出整体的一种温馨的气氛。</p>','/upload/news/2019-09/dd/64054fa45adfaa6df894da49a1c379f97141a5.jpg','','','publish','all','open','',NULL,1,343,'2019-09-26 10:19:50','2020-04-29 05:21:08',NULL),(64,18,0,'墙纸和其他装饰画跟墙绘的对比','<p>　墙纸或者其他装饰材料是家庭装饰一笔很大的开销，譬如韩国个性墙纸，高达几千元一个平方，但墙绘只要墙纸三分之一的价格就能使你的墙面变的个性，生动。比起墙纸等其他材料有过之而无不及。 从艺术和美观的角度来讲，墙纸或者其他装饰材料挑来挑去就那么几种，无非是颜色上的变化，纹理基本差不多，没有什么艺术性，如果你选择了墙绘那么只要你喜欢什么我们就能把它放在你想放的任何一面墙或者其他地方，使你的选择余地更为的广泛，并且对你的家具和环境进行配合和点缀使空间更加协调和个性！我们可以根据您的要求做出一面完全属于你独一无二的墙！ 有些人会问那要是要是损坏了或者弄脏了怎么办？如果你是普通的墙我想你可能要花上不少的钱来粉刷整面墙或者整面墙的壁纸。而墙绘不需要，损坏了可以修补，脏了可以擦洗！可以告诉你墙绘用什么材料画</p>','/upload/news/2019-09/b9/adb96966987302236f76dff3ecd363828f618a.jpg','','','publish','all','open','','',1,344,'2019-09-26 10:25:39','2020-04-28 20:44:51',NULL);
