DROP TABLE IF EXISTS `clover_content_product`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `clover_content_product` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `category_id` int(11) NOT NULL,
  `author_id` bigint(20) unsigned NOT NULL DEFAULT '0',
  `title` varchar(200) COLLATE utf8mb4_unicode_ci NOT NULL,
  `price` decimal(10,2) NOT NULL DEFAULT '0.00',
  `content` longtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `image` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT '',
  `tags` varchar(500) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `excerpt` varchar(500) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `status` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'publish',
  `view_permissions` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'all',
  `comment_status` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'open',
  `password` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `extend` text COLLATE utf8mb4_unicode_ci,
  `attribute` text COLLATE utf8mb4_unicode_ci,
  `album` text COLLATE utf8mb4_unicode_ci,
  `is_recommend` smallint(1) NOT NULL DEFAULT '0' COMMENT '是否推荐',
  `is_offer` smallint(1) NOT NULL DEFAULT '0' COMMENT '是否特价',
  `click_count` bigint(20) NOT NULL DEFAULT '0',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '最后一次修改时间',
  `published_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `title` (`title`),
  KEY `type_status_date` (`status`,`created_at`,`id`),
  KEY `category_id` (`category_id`),
  KEY `status` (`status`),
  KEY `click_count` (`click_count`),
  KEY `is_recommend` (`is_recommend`),
  KEY `is_offer` (`is_offer`)
) ENGINE=MyISAM AUTO_INCREMENT=61 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

